import { useState } from "react";


export default function Alerta({children}) {
  const [mostrarAlert, setAlerta] = useState();

  return (
    <div>
      {mostrarAlert && (
        <div className="alert alert-danger mt-3" role="alert">
          {children}  
        </div>
      )}
    </div>
  );
}
